import React from "react";
import LoginForm from "./components/LoginForm";
import "./App.css"
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";



function App() {
  return (
    <Router>
      <div className="App">
        <Route path="/login" component={LoginForm}></Route>
      </div>
    </Router>
  );
}

export default App;
